CREATE DATABASE wch
ALTER DATABASE [wch] COLLATE Chinese_PRC_CI_AS
go
use [wch]
go
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE TABLE wch_Department
(  
    DepID tinyint PRIMARY KEY IDENTITY(1,1), 
    DepName NVARCHAR (20) NOT NULL ,     
)

CREATE TABLE wch_Class 
(
    ClassID INT PRIMARY KEY IDENTITY(1,1),
    ClassName NVARCHAR(8),
    DepID TINYINT FOREIGN KEY REFERENCES wch_Department(DepID),
    StuNum INT NULL,

)
CREATE TABLE wch_Student
(
    StuID NVARCHAR(20) PRIMARY key ,
    StuName NVARCHAR(8) NOT NULL,
    Gender BIT NOT NULL,
    ClassID INT FOREIGN KEY REFERENCES wch_Class(ClassID),  
    DepID TINYINT FOREIGN KEY REFERENCES wch_Department(DepID), 
    StuAge TINYINT CHECK( StuAge>0),
    Tel NVARCHAR(20) NULL,
    Grade DATE,
    [Address] NVARCHAR(50) NULL,
)
CREATE TABLE wch_Teacher
(
    TeaID NVARCHAR(20) PRIMARY KEY,
    TeaName NVARCHAR(8) NOT NULL,
    Gender BIT not NULL,
    DepID TINYINT  FOREIGN KEY REFERENCES wch_Department(DepID),
    TeaAge TINYINT CHECK(TeaAge>0),
    Tel NVARCHAR(20) NULL,
    [Address] NVARCHAR(50) NULL, 
)
CREATE TABLE wch_Schedule
(
	ScheduleID INT IDENTITY(1,1) PRIMARY KEY,
	TimeSpan NVARCHAR(20) NOT NULL,
)
CREATE TABLE wch_Theatre
(
    TheatreID int PRIMARY KEY IDENTITY(1,1),
    SeatCapacity INT NOT NULL,
    [Site] NVARCHAR(20) NOT NULL,
)
CREATE TABLE wch_Term
(
    TermID int PRIMARY KEY IDENTITY(1,1),
    TermName NVARCHAR(30) NOT NULL,
    StartTime NVARCHAR(20) NULL,
    EndTime NVARCHAR(20) NULL,
    StartChoice NVARCHAR(20) NULL,
    EndChoice NVARCHAR(20) NULL,
)
CREATE TABLE wch_Course
(
    CourseID int IDENTITY(1,1) PRIMARY KEY,
    CourseName NVARCHAR(30) NOT NULL,
    Period INT NOT NULL,
    Credit int NOT NULL,
    DepID TINYINT FOREIGN KEY REFERENCES wch_Department(DepID),
)
CREATE TABLE  wch_TimeTable
(
	TimeID int IDENTITY(1,1) primary key,
	CourseID int,
	TeaID nvarchar(20),
	StuNum int default 0,
	Capacity int not null,
	AllowView bit default 0,
	FOREIGN KEY (CourseID) REFERENCES wch_Course(CourseID),
	FOREIGN KEY (TeaID) REFERENCES wch_Teacher(TeaID),
)
CREATE TABLE wch_TimeTableDetail
(
	TimeID int FOREIGN KEY REFERENCES wch_TimeTable(TimeID),
	TermID int FOREIGN KEY REFERENCES wch_Term(TermID),
	[Day] TINYINT check([Day]>=0 AND [Day]<=7),
	ScheduleID int FOREIGN KEY REFERENCES wch_Schedule(ScheduleID),
	TheatreID int FOREIGN KEY REFERENCES wch_Theatre(TheatreID),
    CONSTRAINT pk_wch_TimeTableDetail PRIMARY KEY
    (
        TimeID,TermID,[Day],ScheduleID,TheatreID
    )
)
CREATE TABLE wch_CourseSelection
(
    StuID NVARCHAR(20) FOREIGN KEY REFERENCES wch_Student(StuID),
    TimeID INT NULL FOREIGN KEY REFERENCES wch_TimeTable(TimeID),
    Mark FLOAT null,
    CONSTRAINT pk_wch_CourseSelection PRIMARY KEY(StuID),
)
CREATE TABLE wch_Login
(
	UserID NVARCHAR(20) primary key,
	Passwd varchar(50) not null,
	[Identity] int  not null,
	Nickname nvarchar(20) null,
	PhotoPath varchar(100) null,
	AllowLogin bit not null,
)

